from typing import List


class Solution:

    cache = dict()

    def twoSum(self, sorted_nums, val):
        if val in self.cache:
            return None
        i = 0
        j = len(sorted_nums) - 1

        ret_vals = []
        while i < j:
            two_sum = sorted_nums[i] + sorted_nums[j]
            if two_sum == val:
                ret_val = [sorted_nums[i], sorted_nums[j], -val]
                ret_val.sort()
                ret_vals.append(ret_val)
                i += 1
            elif two_sum < val:
                i += 1
            else:
                j -= 1
        self.cache[val] = ret_vals
        return ret_vals

    def remove_item(self, nums, i):
        tmp = nums[:]
        del tmp[i]
        return tmp

    def threeSum(self, nums: List[int]) -> List[List[int]]:
        self.cache = dict()
        keys = dict()
        potential_answers = []
        nums.sort()

        for i in range(len(nums)):
            aa = self.twoSum(self.remove_item(nums, i), -nums[i])
            if aa is not None:
                for a in aa:
                    if a[0] not in keys:
                        keys[a[0]] = {a[1]: None}
                        potential_answers.append(a)
                    elif a[1] not in keys[a[0]]:
                        keys[a[0]][a[1]] = None
                        potential_answers.append(a)

        return potential_answers


